When you first start, always try to summon <a rel="nofollow" href="https://db.ygoprodeck.com/card/?search=Number%20S0%3A%20Utopic%20ZEXAL">Utopic Zexal</a>. Use <a rel="nofollow" href="https://db.ygoprodeck.com/card/?search=Gallant%20Granite">Gallant Granite</a>  to later summon him from the graveyard with <a rel="nofollow" href="https://db.ygoprodeck.com/card/?search=Gagagaga%20Magician">GAGAGAGA magician</a> to go to <a rel="nofollow" href="https://db.ygoprodeck.com/card/?search=Number%20F0%3A%20Utopic%20Future">Utopic Future</a> ...

&nbsp;

Try to make the best out of the deck yourself :)

&nbsp;

Summon number 97 using glow and eyes, detach glow:

&nbsp;

Enjoy 97 11200 attack and 1 free Galaxy eyes SS from your deck.

